import React, { useEffect, useState } from "react";

function App() {
  const [transactions, setTransactions] = useState([]);
  const [income, setIncome] = useState(0);
  const [expenses, setExpenses] = useState(0);
  const [balance, setBalance] = useState(0);

  // Fetch transactions from backend
  useEffect(() => {
    fetch("http://localhost:5000/transactions")
      .then((res) => res.json())
      .then((data) => {
        setTransactions(data);

        // Calculate totals
        let totalIncome = 0;
        let totalExpenses = 0;

        data.forEach((t) => {
          if (t.type === "income") totalIncome += t.amount;
          else totalExpenses += t.amount;
        });

        setIncome(totalIncome);
        setExpenses(totalExpenses);
        setBalance(totalIncome - totalExpenses);
      })
      .catch((err) => console.error("Error fetching data:", err));
  }, []);

  return (
    <div style={{ fontFamily: "Arial", padding: "30px" }}>
      <h1 style={{ textAlign: "center", marginBottom: "30px" }}>
        💼 MorganLedger
      </h1>

      <div style={{ display: "flex", justifyContent: "space-around", marginBottom: "40px" }}>
        <div>
          <h2>Income</h2>
          <p style={{ color: "green", fontSize: "20px" }}>+${income}</p>
        </div>
        <div>
          <h2>Expenses</h2>
          <p style={{ color: "red", fontSize: "20px" }}>-${expenses}</p>
        </div>
        <div>
          <h2>Balance</h2>
          <p style={{ fontSize: "20px" }}>${balance}</p>
        </div>
      </div>

      <h2>Transaction History</h2>
      <table style={{ width: "100%", borderCollapse: "collapse" }}>
        <thead>
          <tr style={{ backgroundColor: "#f0f0f0" }}>
            <th style={{ border: "1px solid #ccc", padding: "10px" }}>Title</th>
            <th style={{ border: "1px solid #ccc", padding: "10px" }}>Amount</th>
            <th style={{ border: "1px solid #ccc", padding: "10px" }}>Category</th>
            <th style={{ border: "1px solid #ccc", padding: "10px" }}>Type</th>
          </tr>
        </thead>
        <tbody>
          {transactions.length > 0 ? (
            transactions.map((t) => (
              <tr key={t.id}>
                <td style={{ border: "1px solid #ccc", padding: "10px" }}>{t.title}</td>
                <td style={{ border: "1px solid #ccc", padding: "10px" }}>${t.amount}</td>
                <td style={{ border: "1px solid #ccc", padding: "10px" }}>{t.category}</td>
                <td style={{ border: "1px solid #ccc", padding: "10px" }}>{t.type}</td>
              </tr>
            ))
          ) : (
            <tr>
              <td colSpan="4" style={{ textAlign: "center", padding: "20px" }}>
                No transactions yet
              </td>
            </tr>
          )}
        </tbody>
      </table>
    </div>
  );
}

export default App;
